import React from 'react';
import Authorization from "./authorization";
import {connect} from "react-redux";
import {auth, updateEmail, updatePassword, validEmail, validPassword} from "../../../redux/authReducer";

class AuthorizationContainer extends React.Component{

    componentDidMount() {
        let centrifuge = new Centrifuge('ws://192.168.3.105:8000/connection/websocket');

        centrifuge.subscribe("calc", function(message) {
            console.log(message);
        });

        // let btn = document.getElementById("btnSend");
        // btn.onclick = function() {
        //     $.ajax({
        //         url: '/api/v1/user/auth/logout',
        //         method: 'get',
        //         data: {},
        //         success: function(data){
        //             console.log('Good!');
        //         }
        //     });
        // }
        //
        centrifuge.connect();
    }

    authUser(){
        this.props.auth(this.props.authorization.email, this.props.authorization.password);
    }
    render() {
        return <Authorization {...this.props} authUsers={this.authUser.bind(this)}/>
    }
}
let mapStateToProps=(state)=>{
    return{
        authorization:state.AuthPage
    }
};
const AuthorizationContainerExport = connect(mapStateToProps,{updateEmail,updatePassword,auth,validEmail,validPassword})(AuthorizationContainer);
export default AuthorizationContainerExport
